/**
 * Booking Confirmation Screen for MediMindPlus
 * Displays consultation details and initiates payment flow
 */

import React, { useEffect, useState } from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  ActivityIndicator,
  Alert,
} from 'react-native';
import { useSelector, useDispatch } from 'react-redux';
import { Ionicons } from '@expo/vector-icons';
import { RootState, AppDispatch } from '../store/store';
import { createPaymentIntent } from '../store/slices/paymentSlice';
import { getConsultationById } from '../store/slices/consultationSlice';

interface RouteParams {
  consultationId: string;
}

interface Props {
  route: { params: RouteParams };
  navigation: any;
}

const BookingConfirmationScreen: React.FC<Props> = ({ route, navigation }) => {
  const dispatch = useDispatch<AppDispatch>();
  const { consultationId } = route.params;

  const { currentConsultation, isLoading: consultationLoading } = useSelector(
    (state: RootState) => state.consultation
  );
  const { paymentIntent, isLoading: paymentLoading } = useSelector(
    (state: RootState) => state.payment
  );

  const [initialLoad, setInitialLoad] = useState(true);

  useEffect(() => {
    loadConsultation();
  }, [consultationId]);

  useEffect(() => {
    // Navigate to payment screen once payment intent is created
    if (paymentIntent && !paymentLoading && !initialLoad) {
      navigation.navigate('PaymentCheckout', {
        consultationId,
        paymentIntent,
      });
    }
  }, [paymentIntent, paymentLoading]);

  const loadConsultation = async () => {
    try {
      await dispatch(getConsultationById(consultationId)).unwrap();
      setInitialLoad(false);
    } catch (error: any) {
      Alert.alert('Error', error || 'Failed to load consultation details');
    }
  };

  const handleProceedToPayment = async () => {
    if (!currentConsultation) return;

    try {
      await dispatch(
        createPaymentIntent({
          consultationId: currentConsultation.id,
          amount: currentConsultation.consultationFee,
        })
      ).unwrap();
    } catch (error: any) {
      Alert.alert('Error', error || 'Failed to create payment');
    }
  };

  const handleCancelBooking = () => {
    Alert.alert(
      'Cancel Booking',
      'Are you sure you want to cancel this booking?',
      [
        { text: 'No', style: 'cancel' },
        {
          text: 'Yes',
          style: 'destructive',
          onPress: () => navigation.goBack(),
        },
      ]
    );
  };

  const formatDate = (dateString: string) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', {
      weekday: 'long',
      year: 'numeric',
      month: 'long',
      day: 'numeric',
    });
  };

  const formatTime = (dateString: string) => {
    const date = new Date(dateString);
    return date.toLocaleTimeString('en-US', {
      hour: '2-digit',
      minute: '2-digit',
    });
  };

  if (consultationLoading || initialLoad) {
    return (
      <View style={styles.loadingContainer}>
        <ActivityIndicator size="large" color="#007AFF" />
        <Text style={styles.loadingText}>Loading consultation details...</Text>
      </View>
    );
  }

  if (!currentConsultation) {
    return (
      <View style={styles.errorContainer}>
        <Ionicons name="alert-circle-outline" size={64} color="#FF3B30" />
        <Text style={styles.errorText}>Consultation not found</Text>
        <TouchableOpacity
          style={styles.backButton}
          onPress={() => navigation.goBack()}
        >
          <Text style={styles.backButtonText}>Go Back</Text>
        </TouchableOpacity>
      </View>
    );
  }

  const provider = currentConsultation.provider;
  const fee = currentConsultation.consultationFee / 100; // Convert cents to dollars

  return (
    <ScrollView style={styles.container} contentContainerStyle={styles.content}>
      {/* Success Header */}
      <View style={styles.successHeader}>
        <Ionicons name="checkmark-circle" size={80} color="#34C759" />
        <Text style={styles.successTitle}>Booking Confirmed!</Text>
        <Text style={styles.successSubtitle}>
          Your consultation has been scheduled
        </Text>
      </View>

      {/* Consultation Details Card */}
      <View style={styles.card}>
        <Text style={styles.cardTitle}>Consultation Details</Text>

        {/* Provider Info */}
        {provider && (
          <View style={styles.detailRow}>
            <Ionicons name="person-outline" size={24} color="#007AFF" />
            <View style={styles.detailContent}>
              <Text style={styles.detailLabel}>Provider</Text>
              <Text style={styles.detailValue}>
                Dr. {provider.firstName} {provider.lastName}
              </Text>
              <Text style={styles.detailSubtext}>{provider.specialty}</Text>
            </View>
          </View>
        )}

        {/* Date */}
        <View style={styles.detailRow}>
          <Ionicons name="calendar-outline" size={24} color="#007AFF" />
          <View style={styles.detailContent}>
            <Text style={styles.detailLabel}>Date</Text>
            <Text style={styles.detailValue}>
              {formatDate(currentConsultation.scheduledStart)}
            </Text>
          </View>
        </View>

        {/* Time */}
        <View style={styles.detailRow}>
          <Ionicons name="time-outline" size={24} color="#007AFF" />
          <View style={styles.detailContent}>
            <Text style={styles.detailLabel}>Time</Text>
            <Text style={styles.detailValue}>
              {formatTime(currentConsultation.scheduledStart)} -{' '}
              {formatTime(currentConsultation.scheduledEnd)}
            </Text>
          </View>
        </View>

        {/* Type */}
        <View style={styles.detailRow}>
          <Ionicons name="medical-outline" size={24} color="#007AFF" />
          <View style={styles.detailContent}>
            <Text style={styles.detailLabel}>Consultation Type</Text>
            <Text style={styles.detailValue}>
              {currentConsultation.consultationType.replace(/_/g, ' ')}
            </Text>
          </View>
        </View>

        {/* Reason */}
        {currentConsultation.reasonForVisit && (
          <View style={styles.detailRow}>
            <Ionicons name="information-circle-outline" size={24} color="#007AFF" />
            <View style={styles.detailContent}>
              <Text style={styles.detailLabel}>Reason for Visit</Text>
              <Text style={styles.detailValue}>
                {currentConsultation.reasonForVisit}
              </Text>
            </View>
          </View>
        )}
      </View>

      {/* Payment Summary Card */}
      <View style={styles.card}>
        <Text style={styles.cardTitle}>Payment Summary</Text>

        <View style={styles.paymentRow}>
          <Text style={styles.paymentLabel}>Consultation Fee</Text>
          <Text style={styles.paymentValue}>${fee.toFixed(2)}</Text>
        </View>

        <View style={styles.divider} />

        <View style={styles.paymentRow}>
          <Text style={styles.totalLabel}>Total Amount</Text>
          <Text style={styles.totalValue}>${fee.toFixed(2)}</Text>
        </View>

        <View style={styles.infoBox}>
          <Ionicons name="information-circle" size={20} color="#007AFF" />
          <Text style={styles.infoText}>
            Payment will be processed securely through Stripe
          </Text>
        </View>
      </View>

      {/* Action Buttons */}
      <View style={styles.actionContainer}>
        <TouchableOpacity
          style={[
            styles.primaryButton,
            paymentLoading && styles.buttonDisabled,
          ]}
          onPress={handleProceedToPayment}
          disabled={paymentLoading}
        >
          {paymentLoading ? (
            <ActivityIndicator color="#FFFFFF" />
          ) : (
            <>
              <Text style={styles.primaryButtonText}>Proceed to Payment</Text>
              <Ionicons name="arrow-forward" size={20} color="#FFFFFF" />
            </>
          )}
        </TouchableOpacity>

        <TouchableOpacity
          style={styles.secondaryButton}
          onPress={handleCancelBooking}
          disabled={paymentLoading}
        >
          <Text style={styles.secondaryButtonText}>Cancel Booking</Text>
        </TouchableOpacity>
      </View>

      {/* Note */}
      <View style={styles.noteContainer}>
        <Text style={styles.noteText}>
          Note: You can reschedule or cancel your appointment up to 24 hours
          before the scheduled time for a full refund.
        </Text>
      </View>
    </ScrollView>
  );
};

